sources.iot.css:
*{margin: 0; padding: 0; box-sizing: border-box}
ul, li {
    list-style: none;
    margin: 0;
    padding: 0;
}
.clearfix:after{/*伪元素是行内元素 正常浏览器清除浮动方法*/
    content: "";
    display: block;
    height: 0;
    clear:both;
    visibility: hidden;
}
.clearfix{
    *zoom: 1;/*ie6清除浮动的方式 *号只有IE6-IE7执行，其他浏览器不执行*/
}

#main {
    position: relative;
}

/*banner开始*/
#main .banner {
    position: relative;
    width: 100%;
    height: 58vw;
    background: url("../images/iot/iot_back.jpg") no-repeat;
    background-size: 100% 100%;
}

/*banner top开始*/
#main .banner .topWrapper {
    width: 100%;
    height: 2vw;
    color: rgb(153, 153, 153);
    background: rgba(0, 0, 0, 1)
}
#main .topWrapper .top {
    width: 62%;
    height: 100%;
    margin-left: 18%;
    font-size: 12px;
    line-height: 2vw;
}
#main  .top .official {
    /*color: rgb(28, 144, 246);*/
    margin-right: 54%;
}

#main .top a {
    float: right;
    margin-right: 4%;
    color: rgb(153, 153, 153);
}
#main .top a:hover {
    color: rgb(28, 144, 246);
}

#main .top a:first-child {
    float: left;
    margin-right: 0;
}


/*banner brand开始*/
#main .banner .brandWrapper {
   border-bottom: 1px solid rgba(255, 255, 255, 0.1);
}
#main .banner .brand {
    width: 62%;
    height: 4.2vw;
    line-height: 4.2vw;
    margin: 0 0 0 18%;
    display: flex;
}

#main .brand .imgWrapper {
    width: 6vw;
    margin-right: 8vw;
}
#main .brand .imgWrapper img {
    width: 100%;
}

#main .brand a {
    margin-right: 5%;
    font-size: 14px;
    color: #FFFFFF;
}
#main .brand a:hover {
    color: rgb(28, 144, 246);
}


/*banner middle开始*/
#main .banner .middle {
    position: relative;
    height: 32vw;
    /*margin: 4vw auto;*/
}

#main .middle .imgWrapper {
    height: 100%;
}
#main .middle .imgWrapper img {
    height: 100%;
}
#main .middle .title {
    position: absolute;
    top: 9vw;
    left: 50%;
    margin-top: 0;
    transform: translate(-50%);
}
#main .middle .title p:first-child {
    font-size: 38px;
    color: #ffffff;
}
#main .middle .title .aim {
    margin-top: 1.4vw;
    font-size: 19px;
    color: #ffffff;
    text-align: center;
}
#main .middle .title .btn {
    margin-top: 4vw;
}
#main .middle .title .btn > div {
    width: 6.8vw;
    height: 2vw;
    text-align: center;
    line-height: 2vw;
    box-sizing: content-box;
}
#main .middle .title .btn > div a {
    color: #ffffff;
    font-size: 14px;
    display: block;
    height: 100%;
    box-sizing: content-box;
}
#main .middle .title .btn > div .onlineAsk {
    border: 1px solid #ffffff;
}
#main .middle .title .btn > div .onlineAsk:hover {
    color: rgb(28, 144, 246);
    background: #ffffff;
}

/*#main .middle .title .btn > div:first-child {*/
    /*border: none;*/
    /*background: rgb(5, 112, 207);*/
    /*margin-right: 3vw;*/
    /*color: #ffffff;*/
/*}*/



/*banner bottom开始*/
#main .banner .bottom {
    width: 100%;
    position: absolute;
    bottom: 0;
    background: rgba(255, 255, 255, 0.03);
}
#main .bottom div {
    width: 18vw;
    border-right: 1px solid rgba(255, 255, 255, 0.1);;
    padding: 0 4vw 0 2.6vw;
}
#main .bottom div:first-child {
    margin-left: 18%;
}
#main .bottom div:last-child {
    border-right: none;
}
#main .bottom div p:first-child {
    color: #ffffff;
    margin-top: 1vw;
    font-size: 16px;
}
#main .bottom div p:last-child {
    color: rgb(97, 97, 97);
    margin-top: 0.5vw;
    font-size: 14px;
    line-height: 24px;
}
#main .bottom > div:hover {
    /*height: 7.7vw;*/
    background: rgba(27, 29, 63, 0.3);
    /*-webkit-transform: scale(1.1);*/
    /*-moz-transform: scale(1.1);*/
    /*-ms-transform: scale(1.1);*/
    /*-o-transform: scale(1.1);*/
    /*transform: scale(1.1);*/
}

/*banner结束*/

/*partition开始*/
#main .partition {

}
#main  .title {
    font-size: 30px;
    font-weight: 500;
    margin-top: 3vw ;
    text-align: center;
}


/*partition part1开始*/
#main .part1 {
    width: 100%;
    /*height: 44vw;*/
    background: rgba(240, 240, 240, 1);;
    border-top: 1px solid #ffffff; /*清除外边距合并*/
}

#main .part1 .bg {
    width: 70%;
    height: 70%;
    margin: 3.9vw auto 0;
    background: url("../images/iot/part_back.png");
    background-size: 100% 100%;
}
#main .part1 .bg > div {
    margin-top: 4vw;
}
#main .part1 .bg > div > div {
    width: 13vw;
    margin-right: 5vw;
    /*height: 24vw;*/
    padding: 4vw 0;
}
/*#main .part1 .bg .bigNow {*/
    /*transform: scale(1.2);*/
/*}*/

/*#main .part1 .bg > div > div:hover {*/
    /*-webkit-transform: scale(1.2);*/
    /*-moz-transform: scale(1.2);*/
    /*-ms-transform: scale(1.2);*/
    /*-o-transform: scale(1.2);*/
    /*transform: scale(1.2);*/
/*}*/

.divHover1 {
    -webkit-transform: scale(1.2);
    -moz-transform: scale(1.2);
    -ms-transform: scale(1.2);
    -o-transform: scale(1.2);
    transform: scale(1.2);
}
#main .part1 .bg > div > div > img {
    width: 100%;
}
#main .part1 .bg .title1 {
    width: 100%;
    /*font-size: 24px;*/
    font-size: 1.5vw;
    font-weight: 500;
    text-align: center;
    margin-top: 1.3vw;
}
#main .part1 .bg .info {
    width: 100%;
    /*font-size: 14px;*/
    font-size: 1vw;
    line-height: 2;
    margin-top: 1.3vw;
    /*text-align: center;*/
}


/*partition part2开始*/
#main .part2 {
    width: 100%;
    /*height: 44vw;*/
}
#main .part2 ul {
    width: 70%;
    border-bottom: 1px solid rgb(187, 187, 187);
    margin: 4.2vw auto 0;
}
#main .part2 ul .special {
    border-bottom: 2px solid rgb(75, 117, 255);
    color: rgb(75, 117, 255);
}
#main .part2 ul li {
    color: #808080;
}

#main .part2 ul li {
    float: left;
    margin-right: 7.2vw;
    /*font-size: 18px;*/
    font-size: 1vw;
    line-height: 36px;
}

#main .part2 ul li > div {
    width: 5vw;
    height: 2.5vw;
    line-height: 2.5vw;
    text-align: center;
    font-weight: 600;
}
#main .part2 .info {
    width: 70%;;
    height: 3.8vw;
    margin: 1.7vw auto 0;
    font-size: 18px;
    line-height: 36px;
    text-align: center;
}

#main .part2 .imgWrapper {
    width: 60%;
    height: 22vw;
    margin: 1vw auto 0;
    background: url("../images/iot/par2_img1.png");
}

/*#main .part2 .imgWrapper {*/
    /*width: 100%;*/
/*}*/
@keyframes scaleBG {
    from{
       background-size:100% 100%;
    }
    to{
        background-size: 110% 110%;
    }
}
@keyframes scaleSM {
    from{
        background-size: 110% 110%;
    }
    to{
        background-size: 100% 100%;
    }
}



/*partition part3开始*/
#main .part3 {
    width: 100%;
    /*height: 31vw;*/
    background: rgba(240, 240, 240, 1);
    border: 1px solid #ffffff;
    padding-bottom: 2vw;

}
#main .part3 > div {
    width: 70%;
    margin: 0 auto;
    font-size: 16px;
}
#main .part3 > div > ul:first-child {
    margin: 5vw 0 3vw 0;
}
#main .part3 > div > ul p {
    margin-top: 1vw;
}
#main .part3 > div > ul > li {
    width: 9.5vw;
    font-weight: 600;
}

#main .part3 > div > ul div {
    height: 3.6vw;
}

#main .part3 > div > ul p {
    text-align: center;
}

/*#main .part3 > div > ul > li:hover {*/
    /*color: rgb(75, 117, 255);*/
/*}*/
#main .part3 > div > ul div img {
    height: 100%;
}


/*partition part4开始*/
#main .part4 {
    width: 100%;
    /*height: 25vw;*/
}
#main .part4 ul {
    width: 70%;
    margin: 3.5vw auto 0;
    padding-bottom: 6vw;
}
#main .part4 ul li {
    width: 10vw;
    /*width: 25%;*/
}
#main .part4 ul li .title {
    font-size: 30px;
    margin: 1.5vw 0;
}

#main .part4 ul li .info {
    width: 100%;
    font-size: 16px;
    line-height: 24px;
    height: 3.5vw;
    text-align: center;
    color: #666666;
}

#main .part4 ul li > div {
    width: 5.5vw;
}

#main .part4 ul li > div > img {
    width: 100%;
}

/*partition part5开始*/
#main .part5 {
    width: 100%;
    height: 32vw;
    background: rgba(240, 240, 240, 1);;
    border: 1px solid #ffffff;
}
#main .part5 ul:first-child {
    margin-top: 2vw;
}
#main .part5 ul {
    width: 70%;
    margin: 1vw auto;
}
#main .part5 ul li {
    width: 11vw;
}
#main .part5 ul li img {
    width: 100%;
}


/*partition part6开始*/
#main .part6 {
    height: 10vw;
    background: url("../images/iot/part6_back.png");
    background-size: 100% 100%;
    border-top: 1px solid #ffffff;
}
#main .part6 p {
    margin-top: 2.5vw;
    margin-bottom: 0;
    text-align: center;
    font-size: 30px;
    color: #ffffff;
}

#main .part6 div {
    width: 11vw;
    height: 2vw;
    color: #ffffff;
    margin: 1vw auto 0;
}
#main .part6 div a {
    display: block;
    height: 100%;
    line-height: 2vw;
    text-align: center;
    border: 1px solid #ffffff;
    color: #ffffff;
}
#main .part6 div a:hover {
    color: rgb(28, 144, 246);
    background: #ffffff;
    cursor: pointer;
    border: none;
}

/*固定栏side开始*/
#main .side {
    position: fixed;
    top: 25vw;
    right: 1vw;
}

#main .side li {
    width: 2.6vw;
    margin-top: 0.6vw;
}
.side .contPhone {
    position: relative;
}
.side .phoneShow {
    display: none;
    position: absolute;
    top: 0.2vw;
    right: 4.2vw;
    width: 13vw;
    height: 3vw;
    background: #ffffff;
    border-radius: 3px;
    text-align: center;
    line-height: 3vw;
    font-size: 1vw;
    border: 1px solid #e1e8f0;
}
.side .phoneShow1 {
    display: none;
    position: absolute;
    top: 1vw;
    right: 3.5vw;
    width: 1.5vw;
    height: 1.5vw;
    background: #ffffff;
    transform: rotate(45deg);
    border-top: 1px solid #e1e8f0;
    border-right: 1px solid #e1e8f0;
}
.side .ask {
    display: none;
    position: absolute;
    top: 4vw;
    right: 4.2vw;
    width: 13vw;
    height: 3vw;
    background: #ffffff;
    border-radius: 3px;
    text-align: center;
    line-height: 3vw;
    font-size: 1vw;
    border: 1px solid #e1e8f0;
}
.side .ask1 {
    display: none;
    position: absolute;
    top: 4.8vw;
    right: 3.5vw;
    width: 1.5vw;
    height: 1.5vw;
    background: #ffffff;
    transform: rotate(45deg);
    border-top: 1px solid #e1e8f0;
    border-right: 1px solid #e1e8f0;
}

.side #wxCode .code {
    display: none;
    position: absolute;
    top: 4vw;
    right: 4.2vw;
    width: 10vw;
    height: 10vw;
    background: #ffffff;
    border: 1px solid #e1e8f0;

}
.side #wxCode .code > div{
    width: 6vw;
    margin: 0 auto;
}
.side #wxCode .code p {
    margin: 10px auto;
    text-align: center;
    color: rgb(28, 144, 246);
}
.side #wxCode .code > div img{
    width: 100%;
}

.side #wxCode .code1 {
    display: none;
    position: absolute;
    top: 7.8vw;
    right: 3.5vw;
    width: 1.5vw;
    height: 1.5vw;
    background: #ffffff;
    transform: rotate(45deg);
    border-top: 1px solid #e1e8f0;
    border-right: 1px solid #e1e8f0;
}


#main .side li img {
    width: 100%;
}



#main .side #topBtn {
    display: none;
}





/*pc端响应式*/

@media (max-width: 1440px) {
    /*#main .title {*/
        /*font-size: 30px;*/
    /*}*/
    #main .bottom div p:first-child {
        font-size: 14px;
    }
    #main .bottom div p:last-child {
        font-size: 9px;
        line-height: 20px;
    }
    #main .middle .title .btn > div a {
        color: #ffffff;
        font-size: 10px;
    }
    #main .part1 .bg .title1 {
        /*font-size: 18px;*/
    }
    #main .part1 .bg .info {
        /*font-size: 10px;*/
        /*line-height: 18px;*/
    }

    #main .part2 .info {
        font-size: 14px;
        line-height: 26px;
    }
    /*#main .part2 ul li > div {*/
        /*font-size: 12px;*/
    /*}*/
    #main .part3 > div > ul p {
        font-size: 12px;
    }
    #main .part4 ul li .title {
        font-size: 20px;
    }
    #main .part4 ul li .info {
        font-size: 16px;
        line-height: 20px;
    }
    #main .part6 p {
        font-size: 23px;
    }
    #main .part6 div a {
        font-size: 14px;
    }
}
@media (max-width: 1366px) {
    #main .part2 ul li {
        margin-right: 7vw;
    }
    #main .part2 ul li > div {
        width: 5.4vw;
    }
    #main .part2 .info {
        font-size: 16px;
        line-height: 28px;
    }
}
@media (max-width: 1024px) {
    #main .title {
        font-size: 18px;
    }
    #main .bottom div p:first-child {
        font-size: 12px;
    }
    #main .bottom div p:last-child {
        font-size: 9px;
        line-height: normal;
    }
    #main .middle .title p:first-child {
        font-size: 20px;
    }
    #main .middle .title .aim {
        font-size: 9px;
    }
    #main .part2 .info {
        font-size: 9px;
        line-height: 20px;
        height: auto;
    }
    #main .part3 > div {
        font-size: 9px;
    }
    #main .part3 > div > ul > li {
        width: 11.5vw;
    }
    #main .part4 ul li .title {
        font-size: 16px;
    }
    #main .part4 ul li .info {
        font-size: 9px;
        line-height: 13px;
    }
    #main .part6 p {
        font-size: 16px;
    }
    #main .part6 div a {
        font-size: 10px;
    }
}

@media (max-width: 1280px) {
    #main .part2 ul li {
        margin-right: 5vw;
    }
    #main .part2 ul li > div {
        width: 6.4vw;
    }
    #main .part4 {
        /*height: 27vw;*/
    }
}
@media (max-width: 1000px) {
    #main .part1 .bg .info {
        line-height: 17px;
    }
    #main .part3 > div > ul > li p {
        height: 3.6vw;
    }
    .side #wxCode .code {
        font-size: 9px;
    }

    .side #wxCode .code p {
        margin-top: 3px;
        margin-bottom: 3px;
    }
    #main .brand a {
        font-size: 12px;
    }
}

