    .banner_h5 {
        display: none;
    }
    .part1_h5 {
        display: none;
    }
    .part2_h5 {
        display: none;
    }
    .part3_h5 {
        display: none;
    }
    .part4_h5 {
        display: none;
    }
    .part5_h5 {
        display: none;
    }
    .part6_h5 {
        display: none;
    }
    .footer_h5 {
        display: none;
    }
}
